import './App.css';

function App() {
  return (
    <Router>
    <div id="wrapper">

      {/* <!-- Sidebar --> */}
        <Sidebar/>
      {/* <!-- End of Sidebar --> */}

      {/* <!-- Content Wrapper --> */}
      <div id="content-wrapper" className="d-flex flex-column">

          {/* <!-- Main Content --> */}
          <div id="content">

              {/* <!-- Topbar --> */}
              <Header/>
              {/* <!-- End of Topbar --> */}

              {/* <!-- Begin Page body Content --> */}

              {/* <!-- /.container-fluid --> */}

          </div>
          {/* <!-- End of Main Content --> */}

          {/* <!-- Footer --> */}
          <Footer/>
          {/* <!-- End of Footer --> */}

      </div>
      {/* <!-- End of Content Wrapper --> */}

    </div>
  </Router>
  );
}

export default App;
